import React from 'react';
import Grid from '@mui/material/Grid';
import Container from '@mui/material/Container';
import Box from '@mui/material/Box';
import processImg from '../src/processImg.svg';

function Process() {
  return (
    <Container maxWidth="xl" style={{ background: '#F2E7D6', position: "relative", width: '100%' }}>
      <Grid container spacing={2} justifyContent="center">
        <Grid item xs={12} sm={6} md={4}>
          <h1 style={{ fontSize: 36, fontFamily: "yeseva one", position: "relative" }}>The Process</h1>
        </Grid>
        <Grid item xs={12} sm={6} md={8}>
          <img className="my-svg" src={processImg} alt="Process" width="100%" style={{ position: "relative" }} />
        </Grid>
      </Grid>
      <hr style={{ width: '100%', borderColor: "black" }} />
      <Grid container spacing={2} justifyContent="center">
        <Grid item xs={12} sm={8} md={6}>
          <Box p={0}>
            <p style={{ lineHeight: "30px", fontFamily: "josefin sans", fontSize: 24, position: "relative" }}>A customer-oriented consulting process. Whatever the challenge, time frame, and budget, I can help you on your journey to success.
              A process with the ultimate goal of making you happy.</p>
          </Box>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Process;
